    demo: "https://amruthakalyan.github.io/Quiz/",
    repo: "https://github.com/amruthakalyan/Quiz",
  },
  {
    title: "Random Number Generator",
    description: "Generates random numbers with ease.",
  
    demo: "https://amruthakalyan.github.io/RandomNumberGenerator/",
    repo: "https://github.com/amruthakalyan/RandomNumberGenerator",
  },
  {
    title: "Portfolio Website",
    description: "Personal portfolio showcasing my projects and skills.",
   
    demo: "https://amruthakalyan.github.io/personal-portfolio/",
    repo: "https://github.com/amruthakalyan/personal-portfolio",
  },
  {
    title: "Text Utils",
    description: "Word counter and text utilities app built with React.",
   
    demo: "https://amruthakalyan.github.io/word-counter/",
