    repo: "https://github.com/amruthakalyan/Titanic_Survival_Project",
  },
  {
    title: "Used Car Price Prediction (Random Forest)",
    description: "Predict used car prices using Random Forest Regressor.",
    img: "/images/usedcarprice.jpg",
    demo: "https://github.com/amruthakalyan/Used_Car_Price_Prediction_Project_RandomForest_Regressor",
    repo: "https://github.com/amruthakalyan/Used_Car_Price_Prediction_Project_RandomForest_Regressor",
  },
];


export default function Projects() {
  const [projects, setProjects] = useState([]);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    api
      .get("/projects")
      .then((r) => {
        if (r.data && r.data.length > 0) {
          setProjects(r.data);
        } else {
          setProjects(staticProjects);
        }
        setLoading(false);
      })
      .catch(() => {
        setProjects(staticProjects); // fallback if API fails
        setLoading(false);
      });
  }, []);

  return (
    <section id="projects" className="portfolio">
      <h1>Projects</h1>
      <h5>Click the image to view the Page</h5>

      {loading ? (
        <p>Loading...</p>
      ) : (
        <div className="projects-grid">
          {projects.map((p, i) =>
            p._id ? (
              <ProjectCard key={p._id} p={p} />
            ) : (
              <a key={i} href={p.link} target="_blank" rel="noreferrer">
                <img src={p.img} alt="project" />
              </a>
            )
          )}
        </div>
      )}
    </section>
  );
}
